import React from "react";
import ToDoStore from "../store/calculator";

var Calculator = () => {
  return (
    <div style={{ marginTop: "100px" }}>
      <h1 style={{ margin: "0 auto", textAlign: "center" }}>Calculator</h1>
      <p>{ToDoStore.report()}</p>
    </div>
  );
};
export default Calculator;
